var myApp=angular.module("myApp",["ngRoute","appControllers"]),appControllers=angular.module("appControllers",[]);myApp.config(["$routeProvider","$httpProvider",function(a,b){a.when("/home",{templateUrl:"/views/routes/home.html"}).when("/login",{templateUrl:"/views/routes/login.html",controller:"LogInController"}).when("/register",{templateUrl:"/views/routes/register.html",controller:"RegistrationController"}).when("/displayflies",{templateUrl:"/views/routes/displayflies.html",controller:"DisplayFlyController"}).when("/submitflies",{templateUrl:"/views/routes/submitflies.html",controller:"FlyController"}).when("/streamreport",{templateUrl:"/views/routes/streamreport.html",controller:"DisplayStreamReportController"}).when("/poststreamreport",{templateUrl:"/views/routes/poststreamreport.html",controller:"PostStreamReportController"}).otherwise({redirectTo:"/home"}),b.interceptors.push(["$location","$q",function(a,b){return{response:function(a){return a},responseError:function(a){return 401===a.status&&alert("Incorrect Username or Password"),b.reject(a)}}}])}]);